import Vue from 'vue';
//import Vuetify from 'vuetify/lib/framework';
import { preset } from 'vue-cli-plugin-vuetify-preset-rally/preset'
import Vuetify from 'vuetify/lib'

Vue.use(Vuetify);

export default new Vuetify({
  preset,
  rtl: true,
  theme: {dark : true}
});
